import { BsDot } from "react-icons/bs";
import "./Flight.css";

const data = [
  {
    id: 1,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 2,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 3,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
  {
    id: 4,
    brand: "VietNam Airline",
    flight: "VN - 213",
    time: "21:35 - 23 - 40",
    price: "780,000",
  },
];

const columns = [
  {
    title: "Brand",
    width: 100,
    dataIndex: "brand",
    key: "brand",
    fixed: "left",
  },
  {
    title: "Flight",
    width: 100,
    dataIndex: "flight",
    key: "flight",
    fixed: "left",
  },
  {
    title: "Time",
    dataIndex: "time",
    key: "1",
    width: 150,
  },
  {
    title: "Price",
    dataIndex: "price",
    key: "price",
    width: 150,
  },
  
  {
    title: "Action",
    key: "operation",
    fixed: "right",
    width: 100,
    render: () => <a>Chon</a>,
  },
];
function Flight() {
  return <div className="wrapper"></div>;
}

export default Flight;
